import React from 'react';
import './Main.css';
import Home from './Home';
import { Route, Switch } from 'react-router-dom';

const Main = () => {
  return (
    <main>
      <Switch>
          <Route path="/" component={Home} exact />
          {/* <Route path="/about" component={About} />
          <Route path="/shop" component={Shop} /> */}
      </Switch>
    </main>
  );
}

export default Main;
